	const [author, setAuthor] = useState('');
	const [recipe, setRecipe] = useState([]);

	return (
		<Flex direction='column'>
			<Box>
				<Input placeholder='author' name='author' onChange={e => setAuthor(e.target.value)}/>
				<Button variant='outline' onClick={() => console.log('ok')} onClick={console.log(author)}>Add author</Button>
				<Button variant='ghost' onClick={() => console.log(recipe)}>Check state</Button>
			</Box>
		</Flex>
	)
}

export default RecipeField;
